import {
  useEffect,
  useState
} from "react";

import $ from 'jquery';
const Paginate = ()=>{
  const[data,setData] = useState([]);
  const getData = ()=>{
    $.ajax({
      type: "GET",
      url: "https://jsonplaceholder.typicode.com/photos?_start=0&_limit=1",
      success: (response)=>{
        return setData(response)
      //   return setData((oldData)=>{
      //     return [
      //       ...oldData,
      //       response
      //     ]
      //   })
      // }
}
 });
  }

  useEffect(getData,[]);

  const Column = ({newItem})=>{
    console.log(newItem);
    return (<div className="col-md-3">
      <div className="card">
        <div className="card-body">
          {
            newItem[0].title
          }
        </div>
      </div>
    </div>
  )
  }

  const design = (
    <>
      <div className="container py-4">
        <div className="row">
          {
            data.map((item)=>{
              return <Column newItem={item}/>
            })
          }
        </div>
      </div>
    </>
  );
  return design;
}

export default Paginate;
